import{_ as e,o as t,c as o,O as n}from"./chunks/framework.9482e208.js";const p=JSON.parse(`{"title":"§ 33.2-1027.1 Distribution of funds to owner or owner's attorney.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1027.1.md","filePath":"vacode/33.2-1027.1.md"}`),r={name:"vacode/33.2-1027.1.md"},a=n('<h1 id="§-33-2-1027-1-distribution-of-funds-to-owner-or-owner-s-attorney" tabindex="-1">§ 33.2-1027.1 Distribution of funds to owner or owner&#39;s attorney. <a class="header-anchor" href="#§-33-2-1027-1-distribution-of-funds-to-owner-or-owner-s-attorney" aria-label="Permalink to &quot;§ 33.2-1027.1 Distribution of funds to owner or owner&#39;s attorney.&quot;">​</a></h1><p>Notwithstanding any other provision of this chapter, upon any settlement or final determination resulting in a judgment for the owner, whether funds have been paid into the court or are outstanding, all such funds due and owing shall be payable to the owner or, if the owner consents, to the owner&#39;s attorney within 30 days of the settlement or final determination, unless otherwise subject to § <a href="/vacode/25.1-240/">25.1-240</a>, <a href="/vacode/25.1-241/">25.1-241</a>, <a href="/vacode/25.1-243/">25.1-243</a>, or <a href="/vacode/25.1-250/">25.1-250</a>. Nothing in this section shall be construed to alter the priority of liens or any obligation to satisfy or release any outstanding liens on the property or the funds.</p><p>2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0842" target="_blank" rel="noreferrer">842</a>.</p>',3),i=[a];function s(d,h,c,f,l,u){return t(),o("div",null,i)}const w=e(r,[["render",s]]);export{p as __pageData,w as default};
